시카고피자전문점연희점.review:
 예전 90년대식 피자를 제대로 만듭니다. 그리운 맛을 찾는 분들은 한번씩 방문해보는것도 좋을 것 같습니다. 피자는 자극적이지 않고 맛있습니다. 동네에 있는 꽤 오래된 피자집.
외관도 엄청 낡고 밖에서 보면 간판이니 인테리어도 미묘해서 발길이 잘 안가던 곳.… 먹느라...피자 사진을 안 찍었...;;

7년 이상 자주 시켜먹는 우리동네 피자집.… 여기 피자만 먹어요. 치즈 듬뿍, 도우가 두꺼운데도 보들보들 맛있어서 버릴게 없어요. 레귤러가 만원대. 가격도 착하니 유명브랜드 피자는 먹질 못해요.^^ 풍부한 토핑과 치즈, 한 입 크게 베어 물면 입 안 가득 퍼지는 행복
